import React from 'react';



function Predict() {
    return (
        <div>
            <h3>PREDICT</h3>
            <h2>Select Model:</h2>
            <select>
                <option>
                    sklearn_linear_LSR
                </option>
                <option>
                    polynomial_LSR
                </option>
                <option>
                    linear_LSR
                </option>
            </select>
        </div>
    );
}
export default Predict;
